INSERT INTO `tin_tuc` (`MaTinTuc`, `TieuDe`, `NoiDung`, `NgayDang`, `HinhAnh`, `HienThi`) VALUES
(1, '"Tròn mắt" trước những món ăn lạ lùng nhất thế giới', 'Sự kiện: Món ngon mỗi ngày\nTừ bánh “giọt nước” cho tới xúc xích rắn đuôi chuông, những món ăn kỳ lạ xuất hiện ở khắp nơi trên thế giới, và dưới đây là 10 món ăn “dị” nhất.\n20 món ăn kinh dị nhất thế giới\nCNN liệt kê 8 món ăn vặt "đỉnh" nhất Sài Gòn\nNhững đặc sản kinh dị của châu Á đố bạn dám thử!\n &#34;Tròn mắt&#34; trước những món ăn lạ lùng nhất thế giới - 1\n\n1. Marshmallows bột năng phô mai tại Chicama, London\n\nLoại kẹo dẻo này được làm từ gốc của cây sắn khiến nó có độ dai và vị ngon tuyệt v', '23/03/2017', , 1);
INSERT INTO `tin_tuc` (`MaTinTuc`, `TieuDe`, `NoiDung`, `NgayDang`, `HinhAnh`, `HienThi`) VALUES
(2, 'Chưa bao giờ, việc tiếp cận thực phẩm sạch Nhật Bản lại dễ dàng đến thế', 'Không còn phải tìm kiếm phức tạp, những nguyên liệu tươi ngon nhất của vùng Iwate (Nhật Bản) đã có mặt tại Việt Nam trong tuần lễ Iwate Fair tổ chức tại Trung tâm thương mại Aeon mall Tân Phú Celadon bắt đầu từ ngày 9/1-15/1.\r\nĐất nước Nhật Bản từ lâu đã nổi tiếng khắp thế giới với nền văn hoá ẩm thực đặc sắc. Một trong những yếu tố quan trọng để tạo nên điểm nhấn trong những món ăn Nhật chính là nhờ vào nguồn nguyên liệu tươi ngon, sạch do môi trường, khi hậu thuận lợi, ôn hoà.', '16/03/2017', , 1);
INSERT INTO `tin_tuc` (`MaTinTuc`, `TieuDe`, `NoiDung`, `NgayDang`, `HinhAnh`, `HienThi`) VALUES
(3, 'Thịt bò Hitachi được phân phối chính thức tại Việt Nam', 'Nhân dịp kỷ niệm 10 năm thành lập, chiều ngày 28.12.2016, tại Hà Nội, Công ty CP D&A Việt Nam đã chính thức ra mắt và giới thiệu sản phẩm thịt bò Hitachi. Đây cũng là đơn vị duy nhất nhập khẩu trực tiếp mặt hàng này.\nTrải qua quá trình thương thảo, đàm phán với Hiệp hội bò Hitachi Nhật bản, Công ty D&A Việt Nam đã chính thức ký Hợp đồng vào tháng 9/2016 về việc nhập khẩu và phân phối thịt bò Hitachi tại Việt Nam. Cuối tháng 11/2016, D&A Việt Nam là đơn vị đầu tiên ở Việt Nam nhập khẩu sản phẩm', '10/03/2018', , 1);
INSERT INTO `tin_tuc` (`MaTinTuc`, `TieuDe`, `NoiDung`, `NgayDang`, `HinhAnh`, `HienThi`) VALUES
(4, 'Muốn sống lâu hãy ăn như người Nhật', 'Chế độ ăn uống của người Nhật bao gồm nhiều cá, rau, đậu nành... giúp giảm nguy cơ tử vong, tăng tuổi thọ.\r\n Bí quyết giúp bạn sống lâu hơn  Hết đau nhức khớp, chống thoái hóa với loại quả rất “bình dân” này\r\nTrang Foxnews đưa tin, một nghiên cứu trên tạp chí y học Anh mới đây cho thấy chế độ ăn uống của Nhật Bản bao gồm cá, ngũ cốc, rong biển, trái cây... giúp con người sống thêm 5 năm nữa, giảm tỷ lệ tử vong đến 15%, đặc biệt ngừa nguy cơ tử vong vì bệnh tim mạch và đột quỵ.\r\n\r\n\r\n\r\nChế độ ăn u', '17/03/2017', , 0);
INSERT INTO `tin_tuc` (`MaTinTuc`, `TieuDe`, `NoiDung`, `NgayDang`, `HinhAnh`, `HienThi`) VALUES
(5, 'Sự thật đắng lòng đằng sau những bức ảnh quảng cáo hoàn mỹ', 'Những bức ảnh đồ ăn thường khiến bạn nuốt nước miếng đang ẩn chứa sự thật gì?\r\n Tự cắm hoa trang trí phòng khách ngày tết  Cách trang trí đồ uống như nhà hàng  Những thực phẩm giúp cơ thể lâu già  [Infographic] Cách bảo quản thực phẩm trong nhà\r\nQuảng cáo là một phần không thể thiếu trong các chiến dịch truyền thông của bất cứ sản phẩm nào. Cùng với sự phát triển của công nghệ, hình ảnh của mọi thứ đều trở nên lung linh và hấp dẫn đến không thể cưỡng nổi. Thế nhưng, không phải ai cũng biết rõ ch', '13/05/2016', , 1);

